import axios from 'axios'
import React, { useEffect } from 'react'
import { useHistory } from 'react-router-dom'

const View = () => {
    const history = useHistory()
    const user=localStorage.getItem('userID')
    console.log('hello edflkemf',typeof user)
    useEffect(()=>{
        axios.get('http://localhost:1337/item')
    .then((response)=>{
        console.log(response.data[0].userId.id)
    },(err)=>{
        console.log(err)
    })
    },[])
    console.log("object is here ",response.data[0])

    // console.log(books.data)
    return (
        <>
        {!user ?(
            <center className="m-5">
                <h3>Sorry...
                    No user logged in yet.
                </h3>

                <h4>Please <a className="text-success" onClick={() => { history.push('/login') }}>click here</a> to login</h4>
            </center>
            ):(
                <h3></h3>
            )}
        </>
    )
}

export default View
